import logo from './logo.svg';
import './App.css';
import { getApiReference } from './Api/Api';
import React from 'react';
function App() {

  // ApiCall
  const [data,setData]=React.UseState(null);
  React.useEffect(()=>{
       getApiReference().then(result=>setData(result.data));
  },[]);
  return (
    <div className="App">

    </div>
  );
}

export default App;
